  input: '"TEXT","SA11A1","","October 16, 2002 Ms. Angel L. Williamson Senior Campaign
    Finance Analyst Reports Analysis Division Federal Election Commission 999 E Street,
    N.W.  Washington, D.C.  20463 Re: FEC Letter Requesting Corrections for Amended
    Year End Report; May Monthly Report; August Monthly Report; and September Monthly
    Report (I.D. Number C00346346) Dear Ms. Williamson: This letter is to inform the
    Federal Election Commission (FEC) of corrective actions taken by the Beverly Enterprises,
    Inc. PAC (BevPAC) (Identification Number: C00346346), as requested by your October
    2, 2002, RQ-2 letter. In your letter, you state that certain contributions to
    BevPAC did not contain the appropriate identification of the contributor. Due
    to a computer error, the mailing address for the contributor Eugene Clark was
    stated as Senior Vice President. However, the address should have read One Thousand
    Beverly Way. In your letter, you requested that we submit electronic amendments
    to the Amended Year End Report (7/1/01 - 12/31/01); May Monthly Report (4/1/02
    - 4/30/02); August Monthly Report (7/1/02 - 7/31/02); and September Monthly Report
    (8/1/02 - 8/31/02). Because this error would have been reflected on each of BevPAC''s
    filings during 2002, in addition to the amendments requested by your letter, we
    are submitting electronic amendments for the following filings to correct this
    unintended computer error: February Monthly Report (1/1/02 - 1/31/02); March Monthly
    Report (2/1/02 - 2/28/02); April Monthly Report (3/1/02 - 3/31/02); June Monthly
    Report (5/1/02 - 5/31-02); July Monthly Report (6/1/02 - 6/30/02); October Monthly
    Report (9/1/02 - 9/31/02). In total, BevPAC is filing ten amended reports to correct
    this inadvertent computer error. Again, I apologize for any confusion caused by
    this error. If you have any questions or concerns, please do not hesitate to contact
    me at the number listed above. Sincerely, Wesley D. Bizzell, Esq.  October 16,
    2002 Ms. Angel L. Williamson Senior Campaign Finance Analyst Reports Analysis
    Division Federal Election Commission 999 E Street, N.W. Washington, D.C.  20463
    Re: Corrections for April Monthly Report (I.D. Number C00346346) Dear Ms. Williamson:
    This letter is to inform the Federal Election Commission (FEC) of corrective actions
    taken by the Beverly Enterprises, Inc. PAC (Identification Number:  C00346346),
    as requested by your October 2, 2002, RQ-2 letter. In your letter, you state that
    several contributions were categorized as contributions to a candidate''s primary
    campaign.  However, the primary election had preceded the contribution.  Unfortunately,
    this was a clerical error on the part of our staff who entered the data.  The
    contributions were not designated for the candidates'' primary election campaigns;
    thus, they should have been categorized as a contribution to the candidate''s
    general election since they were made after the date of the primary election.  We
    have submitted electronic amendments to the April Monthly report (3/1/01 -  3/31/01)
    to reflect this unintended error. Again, I apologize for any confusion caused
    by this error.  If you have any questions or concerns, please do not hesitate
    to contact me at the number listed above.  Sincerely, Wesley D. Bizzell. Esq."'
